import './style.css';


function Header(){
    return(
        <div className='header_opacity_container'>
          <div> <h2>Ultra Profile</h2>
            <ul>
                <li> <a href="">HOME</a></li>
                <li> <a href="">MY WORK</a></li>
                <li><a href="">PORTFOLIO</a></li>
                <li><a href="">RESUME</a></li>
                <li><a href="">ABOUT</a></li>
                <li><a href="">CONTACT</a></li>
            </ul>
            </div> 
        </div>
    )
}

export default Header;
